// src/components/Resources.js
import React, { useState } from 'react';
import '../styles/Resources.css';

function Resources() {
  const [url, setUrl] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(`Submitted URL: ${url}`);
    setUrl(''); // Clear the input after submission
  };

  return (
    <div className="resources-page">
      <h1>GROW IMPRESS</h1>
      <p>Your personal growth journey starts here. Learn, grow, and impress</p>

      <div className="resources-content">
        <div className="submission-area">
          <h2>Submit a TED talk for summarization</h2>
          <form onSubmit={handleSubmit}>
            <input
              type="url"
              placeholder="Enter TED Talk URL"
              value={url}
              onChange={(e) => setUrl(e.target.value)}
              required
            />
            <button type="submit">Submit</button>
          </form>
        </div>

        <div className="resources-list">
          <button>Mentorship</button>
          <button>Women in management</button>
          <button>Scholarships</button>
        </div>
      </div>

      <div className="chatbot-icon">
        <img src="/path/to/chatbot-icon.png" alt="Chatbot" />
      </div>
    </div>
  );
}

export default Resources;
